import React from "react";
import { Navbar, Container } from "react-bootstrap";
import { Link, Router } from "react-router-dom";

function Uphead() {
  return (
    <Router>
    <Navbar bg="dark" variant="dark" expand="lg">
      <Container>
        <Navbar.Brand>üåç Travel Explorer</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <div className="ms-auto d-flex gap-3">
            <Link to="/" className="nav-link text-light">Home</Link>
            <Link to="/Cnt" className="nav-link text-light">Contact</Link>
            <Link to="/about" className="nav-link text-light">About</Link>
            <Link to="/Gallery" className="nav-link text-light">Gallery</Link>
          </div>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/Cnt" element={<Cnt />} />
      </Routes>
    </Router>
  );
}

export default Uphead;
